// components/Navbar.js
import React from 'react';
import styles from '../styles/InicioDashboard.module.css';

const Navbar = () => {
  return (
    <nav className={styles.barraNavegacion}>
      <div className={styles.logo}>FinanceSync</div>
      <div className={styles.enlacesNav}>
        <a href="#">Planes</a>
        <a href="#">Blog</a>
        <a href="#">Contacto</a>
      </div>
      <div className={styles.botones}>
        <button className={`${styles.boton} ${styles.botonIniciarSesion}`}>Sesi√≥n</button>
        <button className={`${styles.boton} ${styles.botonCrearCuenta}`}>Cuenta</button>
      </div>
    </nav>
  );
};

export default Navbar;
